<!DOCTYPE html><html><head></head><body><script src="packages/shadow_dom/shadow_dom.debug.js"></script>
<script src="packages/browser/interop.js"></script>
<polymer-element name="rss-feed" attributes="rssfeedarr">
  <template>
   
      <div class="panel panel-default">
      <div class="panel-heading">Politica</div>
      
      <div class="panel-body">
        <p></p>
      </div>
      
      <template repeat="{{rssfeed in rssfeedarr}}">
      
             <span class="help-block">
        {{rssfeed.pubDate}}
         </span>
        <div class="well">
        <dl>
          <dt> {{rssfeed.title}}</dt>
          <dd> {{rssfeed.description}} </dd> 
        </dl>
        </div>

        
      </template>   
          
      </div>
  </template>
  
</polymer-element><script type="application/dart" src="rssfeed.html_bootstrap.dart"></script><script src="packages/browser/dart.js"></script></body></html>
